import java.util.*;
import java.util.Map.Entry;

public class SherlockandtheValidString {
	public static String isValid(String s) {
		HashMap<Character, Integer> hashMap = new HashMap<Character, Integer>();
		for (int i = 0; i < s.length(); i++) {
			if (hashMap.containsKey(s.charAt(i)))
				hashMap.put(s.charAt(i), hashMap.get(s.charAt(i)) + 1);
			else
				hashMap.put(s.charAt(i), 1);
		}

		HashMap<Integer, Integer> frequency = new HashMap<Integer, Integer>();
		for (Map.Entry<Character, Integer> entry : hashMap.entrySet()) {
			if (frequency.containsKey(entry.getValue()))
				frequency.put(entry.getValue(), frequency.get(entry.getValue()) + 1);
			else
				frequency.put(entry.getValue(), 1);
		}

		if (frequency.size() > 2)
			return "NO";
		else if (frequency.size() == 1)
			return "YES";
		else {
			Object[] arr = frequency.keySet().toArray();
			if ((int) arr[0] == 1 && frequency.get(arr[0]) == 1 || (int) arr[1] == 1 && frequency.get(arr[1]) == 1)
				return "YES";

			if (Math.abs((int) arr[0] - (int) arr[1]) == 1) {
				if (frequency.get(arr[0]) == 1 || frequency.get(arr[1]) == 1)
					return "YES";
				else
					return "NO";
			} else
				return "NO";
		}
	}

	public static void main(String[] args) {
		System.out.println(isValid("aabbcd"));
		System.out.println(isValid("aabbccddeefghi"));
		System.out.println(isValid("abcdefghhgfedecba"));
		/*System.out.println(isValid(
				""));*/
	}
}
